function pasteImg() 
{
var imgs=document.querySelectorAll('#ueditor_replace img');
for(i=0;i<imgs.length;i++)
	{
	if(imgs[i].src.indexOf('data:image')==0)
	{if(!imgs[i].hasAttribute('uploading'))
		{
		var img=imgs[i];
		var src=img.src;
		var nwidth=img.width;
		var height=img.height;
		width=nwidth>560?560:nwidth;
		height=width/nwidth*height;
		
		img.src='data:image/gif;base64,';
		img.height=16;
		img.width=16;
		img.setAttribute('id','waitimage');
	img.setAttribute('uploading','true');

		upload(src,width,height);

		}
	
	
	}}

	
};
function upload(base64,wi,he)
{
//加入上传栏
if(!document.getElementById('progressbar'))
{
var bar =document.createElement('progress');
bar.id='progressbar';
bar.value=0;
bar.setAttribute('style','position:absolute;left:20%;top:50px;z-index:auto;');
document.querySelector('.edui-editor-body').appendChild(bar);
}
else {document.getElementById('progressbar').style.display='';document.getElementById('progressbar').value=0;}
var blob=dataUrlToBlob(base64);
var xhr = new XMLHttpRequest();
    xhr.open('GET', 'http://tieba.baidu.com/dc/common/imgtbs?t=' + new Date().getTime(), false);
    xhr.onload = function () 
	{
      var res=JSON.parse(xhr.responseText);
  var tbs = res.data.tbs;

var data=new FormData();
data.append('Filename','333333.png');
data.append('tbs',tbs);
data.append('fid',unsafeWindow.PageData.forum.id);
data.append('file',blob);

GM_xmlhttpRequest({
synchronous:false,
method:'POST',
url:'http://upload.tieba.baidu.com/upload/pic?is_wm=1',
data:data,
onprogress:function(e){callback(e)},
upload:{onprogress:function(e){callback(e);}},
onload:function(d){
					var c=JSON.parse(d.responseText);
				 var b = c.info.pic_id_encode;
				  var e ='http://imgsrc.baidu.com/forum/pic/item/' + b + '.png';
			if(document.getElementById('waitimage'))
				{
				var img=document.getElementById('waitimage');
					img.src=e;
					img.setAttribute('class','BDE_Image');
					img.id='loaded';
					img.width=wi;
					img.height=he;
					img.removeAttribute('uploading');
				}
				else
				{
				var image=new Image();
				image.src=e;
				image.onload=function()
							{
							image.setAttribute('class','BDE_Image');
						var width=image.width;var height=image.height;
							var w=width>560?560:width;var h=w/width*height;
							image.width=w;image.height=h;
							document.querySelector('#ueditor_replace').appendChild(image);
							}
				
				
				
				}
				
				}
})


}
	xhr.send();
function callback(e)

	{
    if ( !e.lengthComputable )
	{ document.getElementById('progressbar').value=1;
	setTimeout(function(){document.getElementById('progressbar').value=0;
      document.getElementById('progressbar').style.display='none';
        },300)
    }
	else{
   document.getElementById('progressbar').style.display='';
   document.getElementById('progressbar').value=(e.loaded/e.total);
   }
	}
	
function binaryToBlob(data)
		{
		
		
		var arr=new Uint8Array(data.length);for(var i=0,l=data.length;i<l;i++){arr[i]=data.charCodeAt(i);
		
		
		
		}
var buffer=arr;
return buildBlob([buffer]);
}
function dataUrlToBlob(dataurl)
{
var datas=dataurl.split(',',2);
var blob=binaryToBlob(atob(datas[1]));
blob.fileType=datas[0].split(';')[0].split(':')[1];
blob.name='xxx.png';
return blob;
};

function buildBlob(parts)
{
blob=new Blob(parts);
return blob;
}	



}
function flashUPload(f) {//f是base64数据
 
			function uploadedHandler(a, d)
				{try{
                        var c =JSON.parse(d);//d是返回的text c是json对象
                        if (c.error_code != 0) {
                                alert("图片化失败")
                        } else {
                                var b = c.info.pic_id_encode;//c是json数据;b是地址信息；
                                var e ='http://imgsrc.baidu.com/forum/pic/item/' + b + '.png';//e是img完整地址;
								document.querySelector('#ueditor_replace').focus();
								var cache=new Image();
								cache.src=e;
								cache.onload=function()
								{
								var width=cache.width;
								var height=cache.height;
								unsafeWindow.test_editor.execCommand("inserthtml", "<img  class='BDE_Image'  src='"+e+"' width='"+width+"' height='"+height+"' />");
								}
                               unsafeWindow.FlashImageLoader.unbind('uploadComplete', arguments.callee)
								
						
						}
					}catch(err){alert(err);}
                }
                function callback(a) 
				{try{
                        unsafeWindow.FlashImageLoader.bind('uploadComplete', uploadedHandler);
                        unsafeWindow.FlashImageLoader.uploadBase64('http://upload.tieba.baidu.com/upload/pic', f.replace(/^.*?base64,/, ''), {
                                tbs: a
                        })
					}catch(err){alert(err);};
                }//事先返回一个图片ID再返回
              GM_xmlhttpRequest({ method:'GET',
                        url: 'http://tieba.baidu.com/dc/common/imgtbs',
                        onload: function(response) 
						{
                               
								callback(JSON.parse(response.responseText).data.tbs);
                                     
                                
                        }
								});

        }
